        $(function() {
            // detect if user is online to show links and images.
            // window.navigator.onLine;
            var homeId = <?=$story['start_passage_id'];?>;
            var lastId = homeId;
            var newId;

            var showPassage = function(newId, lastId, homeId) {
                // hide div relating to lastId
                $('#' + lastId).hide();

                if (newId) {
                    lastId = newId;
                    // Show the passage
                    $('#' + newId).show();
                } else {
                    // No id so show the first passage
                    lastId = homeId;
                    $('#' + homeId).show();
                }

                return lastId;
            };

            // State is null for all browsers on first page load (page entered in address bar as opposed to a hash link)
            // or refresh, but the history is still available
            // NOTE that this is ONLY CALLED on first page load or refresh
            if (! window.history.state) {
                newId = document.location.hash.substring(1);
                lastId = showPassage(newId, lastId, homeId);
            }

            // onpopstate not called on fist page load or refresh in Firefox or IE. Is called in Chrome.
            // Don't want to call showPassage twice (even if just for performance reasons), so show only
            // execute on condition that window.history.state is true.
            // NOTE that this is ALWAYS CALLED in chrome but ONLY CALLED in firefox when not first page load or refresh.
            // So the result is on first page load or refresh, chrome will call the showPassage function twice.
            window.onpopstate = function(event) {
                newId = document.location.hash.substring(1);
                lastId = showPassage(newId, lastId, homeId);
            };

        });
